INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0, 7, 7001, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0, 7, 7002, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0, 7, 7003, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0, 10, 10001, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0, 10, 10002, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0, 10, 10003, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 0, 10, 10004, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0, 12, 12001, "2030/12/17 14:59:59", 105801, -416.5, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0, 13, 13001, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0, 13, 13002, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 0, 13, 13003, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0, 13, 13004, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0, 14, 14001, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 0, 14, 14002, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0, 14, 14003, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0, 14, 14004, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0, 15, 15001, "2030/12/17 14:59:59", 105901, -470.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 0, 16, 16001, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0, 16, 16002, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0, 16, 16003, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0, 16, 16004, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0, 17, 17002, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0, 25, 17004, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0, 25, 17005, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 0, 25, 17006, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0, 25, 17007, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0, 18, 18001, "2030/12/17 14:59:59", 190801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 0, 18, 18002, "2030/12/17 14:59:59", 190801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 0, 19, 19001, "2030/12/17 14:59:59", 190801, -470.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 0, 19, 19002, "2030/12/17 14:59:59", 190801, -470.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 0, 20, 20001, "2030/12/17 14:59:59", 190801, -470.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 0, 20, 20002, "2030/12/17 14:59:59", 190801, -470.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "キャル", "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0, 21, 21001, "2030/12/17 14:59:59", 106001, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "コッコロ", "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0, 21, 21002, "2030/12/17 14:59:59", 105901, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 2104010, "シェフィ", "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 0, 21, 21003, "2030/12/17 14:59:59", 106401, -363.0, 1, 0.0, 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "ペコリーヌ", "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0, 21, 21004, "2030/12/17 14:59:59", 105801, -363.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0, 22, 22001, "2030/12/17 14:59:59", 190801, -430.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 0, 22, 22002, "2030/12/17 14:59:59", 190801, -430.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 0, 23, 23001, "2030/12/17 14:59:59", 190801, -430.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "カリン", "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 0, 23, 23002, "2030/12/17 14:59:59", 190801, -430.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4.08, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 10011, 24, 24001, "2030/12/17 14:59:59", 109001, -385.0, 2, 8.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (5.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 10011, 24, 24002, "2030/12/17 14:59:59", 109001, -385.0, 2, 8.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10.11, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 10011, 24, 24003, "2030/12/17 14:59:59", 109001, -385.0, 2, 8.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (4.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 10011, 24, 24004, "2030/12/17 14:59:59", 109001, -385.0, 2, 8.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (6.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 10011, 24, 24005, "2030/12/17 14:59:59", 109001, -385.0, 2, 8.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 10011, 24, 24006, "2030/12/17 14:59:59", 109002, 0.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 10011, 24, 24007, "2030/12/17 14:59:59", 109002, 0.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 10011, 24, 24008, "2030/12/17 14:59:59", 109002, 0.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 10011, 24, 24009, "2030/12/17 14:59:59", 109002, 0.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 0, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 10011, 24, 24010, "2030/12/17 14:59:59", 109002, 0.0, 1, 0.0, 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2.12, 0, "シズル（バレンタイン）", "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 10011, 24, 24011, "2030/12/17 14:59:59", 109101, -385.0, 2, 8.0, 1);
